export const signUpUser = (username, email, password, roles) => {
  const data = {
    username: username,
    email: email,
    password: password,
    roles: roles,
  };
  fetch(`http://localhost:8080/api/auth/signup`, {
    method: "POST", // or 'PUT'
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify(data),
  })
    .then((response) => response.json())
    .then((data) => {
      console.log("Success:", data);
      if (data != "User was registered successfully!") {
        return data;
      }
    })
    .catch((error) => {
      console.error("Error:", error);
    });
};
